import "./App.css";
import datas from './database/data.json'
import Advisor from "./components/Advisor/Advisor";

function App() {
  const [data, setData] = useState([]);
  const data_edit = datas.data
  data_edit.advisorProfileCollection.items.map()
  useEffect(() => {
    const [data, setData] = useState([]);
    const data_edit = datas.data
    data_edit.advisorProfileCollection.items.map(item=>{
      const random = Math.floor(Math.random() * 2)
      if(random===0){
        return item.status="online"
      }
      return item.status="offline"
    })
    console.log(data_edit.advisorProfileCollection.item);
    // setData(data_edit.advisorProfileCollection.items);
    return (data.length > 0 && <Advisor items={data} />);
      });
  return (data.length > 0 && <Advisor items={data} />);
}

export default App;
